package com.syntax.class02;

public class VariableValues {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		byte num1;
		num1 = 17;
		System.out.println(num1);

		num1=19;
		System.out.println(num1);
		
		short num2;
		num2=327;
		System.out.println(num2);
		
		num2=657;
		System.out.println(num2);
		
		int num3;
		num3=3456;
		System.out.println(num3);
		
		num3=883847;
		System.out.println(num3);
		
	}

}
